const {
    app,
    BrowserWindow,
    Tray,
    Menu,
    nativeImage,
    globalShortcut,
    ipcMain,
    IpcMainEvent,
    session
} = require('electron');
const path = require('path');
const AutoLaunch = require('auto-launch');
const fs = require('fs');

var autoLauncher = new AutoLaunch({
    name: 'my-electron-app'
});

autoLauncher.enable();

autoLauncher.isEnabled()
    .then(function (isEnabled) {
        if (isEnabled) {
            return;
        }
        autoLauncher.enable();
    })
    .catch(function (err) {
        // handle error
    });

function createWindow() {
    const win = new BrowserWindow({
        width: 800,
        height: 600,
        webPreferences: {
            preload: path.join(__dirname, 'preload.js'),
            nodeIntegration: true
        },
        autoHideMenuBar: true
    })

    // win.webContents.openDevTools();

    win.on('close', (ev) => {
        if (win?.isVisible()) {
            ev.preventDefault();
            win.hide();
        }
    });

    win.loadFile('main.html');
}

app.whenReady().then(() => {

    createWindow()

    app.on('activate', () => {
        if (BrowserWindow.getAllWindows().length === 0) {
            createWindow()
        }
    })

    const contextMenu = Menu.buildFromTemplate([
        {
            label: 'Quit',
            click: () => {
                BrowserWindow.getAllWindows().forEach((w) => w.destroy());
                app.quit();
            }
        }
    ]);

    const icon = nativeImage.createFromDataURL('data:image/jpeg;base64,')
    tray = new Tray(icon)

    tray.on('click', () => {
        BrowserWindow.getAllWindows().shift().show();
    });

    tray.setContextMenu(contextMenu)

    globalShortcut.register('Ctrl+Alt+E', () => {
        BrowserWindow.getAllWindows().shift().show();
    });

    ipcMain.on('auth-window', function (event) {
        createLoginWindow(event);
    });

    ipcMain.on('logout', (event) => {
        let defaultSession = session.defaultSession;
        defaultSession.clearStorageData();
        event.sender.send('logout-processed');
    });
})

function createLoginWindow(event) {
    let authWindow = new BrowserWindow({
        center: true,
        minimizable: false,
        closable: true,
        maximizable: false,
        autoHideMenuBar: true,
        skipTaskbar: true,
        show: false,
        fullscreenable: false,
        backgroundColor: 'black',
        width: 440,
        height: 750,
        maxHeight: 750,
        maxWidth: 440,
        minHeight: 750,
        minWidth: 440,
        webPreferences: {
            nodeIntegration: false,
            contextIsolation: true,
        }
    });

    authWindow.once("ready-to-show", () => {
        authWindow.show()
    });

    authWindow.once("closed", () => {
        authWindow.removeAllListeners();
        authWindow = null;
    });

    session.defaultSession.webRequest.onBeforeRequest({urls: ['http://localhost:9589/']}, (details, callback) => {
        event.sender.send('auth-info', ParseAuthInfo(details.url));
        authWindow.close();
        callback({});
    });

    authWindow.loadURL('https://oauth.yandex.ru/authorize?response_type=token&client_id=edd768ddebde45eabab855e1c010e022');
}

function ParseAuthInfo(url) {
    var regexMath = url.match(/access_token=([^&]*).+expires_in=(\d+)/si);
    let token = regexMath[1];
    let expires = Number(regexMath[2]);
    return Object.assign({
        token,
        expires
    });
}
